-- SQL schema and data for vehicle radiator catalog
-- Generated from adrad_text.txt with AI-enhanced parsing
-- Includes intelligent engine code recognition and data enrichment

-- Create vehicles table
CREATE TABLE IF NOT EXISTS vehicles (
    id INTEGER PRIMARY KEY,
    make VARCHAR(100),
    model VARCHAR(100),
    chassis VARCHAR(20),
    year_from INTEGER,
    year_to INTEGER,
    engine VARCHAR(200),
    engine_size VARCHAR(50),
    engine_type VARCHAR(50),
    trans VARCHAR(50)
);

-- Create radiators table
CREATE TABLE IF NOT EXISTS radiators (
    radiator_code VARCHAR(50) PRIMARY KEY
);

-- Create vehicle_radiators link table
CREATE TABLE IF NOT EXISTS vehicle_radiators (
    id INTEGER PRIMARY KEY,
    vehicle_id INTEGER,
    radiator_code VARCHAR(50),
    FOREIGN KEY (vehicle_id) REFERENCES vehicles(id),
    FOREIGN KEY (radiator_code) REFERENCES radiators(radiator_code)
);

